import React from 'react';
import App from './App';
import { render } from 'react-dom';
import { createRoot } from "react-dom/client";

const root = document.getElementById("root");

if (root) {
  const rootElement = createRoot(root);

  if (rootElement && rootElement._reactRootContainer && rootElement._reactRootContainer._internalRoot && rootElement._reactRootContainer._internalRoot.current.child) {
    root.render(<App />);
  } else {
    render(<App />, root);
  }
} else {
  console.error("Element with id 'root' not found.");
}
